import axios from 'axios';
function logout(){
    axios({
        method: 'get',
        url: '/auth/signout',
        data: {}
    }).then((response) => {
        console.log(response);
            alert(response);
            window.location="http://localhost:3000/about";
      }, (error) => {
        console.log(error);
      });
  }


export default logout;
